const TopHalf = styled.div`
overflow: hidden;
overflow-y: scroll;
background: transparent;
border-bottom: 2px solid black;
margin: 15px 0px;
position: absolute;
left: 0px;
width: 88.8%;
height: 240px;

`;

const AttractionIntervals = () => {
    return (
        <TopHalf></TopHalf>
    )
}

export default TopContainer
